import React from 'react';
import IframePic from './IframePic.jsx';
import {
    Button,
    ButtonGroup,
    Card,
    CardImg,
    CardText,
    CardBody,
    Col,
    Container,
    Row
} from 'reactstrap';

const Album = ({ prints }) => {
    console.log('PRINTS', prints[0]);
    return (
        <div className="album py-5 bg-light">
            <div id="tab0" />
            <div id="tab1" />
            <div id="tab2" />
            <div id="tab3" />
            {/* for (var i = 0; i < prints.length; i++){
                console.log(prints[i])
            } */}
            {prints.map((item, key) => {
                console.log('KEY in first map', key);
            })}

            <Container>
                <Row>
                    {prints.map((item, key) => {
                        console.log('KEY', key);
                        if (key < 7) {
                            <div id="tab4">
                                return (
                                <Col md="4" key={key}>
                                    <Card className="mb-4 box-shadow">
                                        <CardImg
                                            top
                                            width="100%"
                                            src={item.src}
                                            alt={item.altText}
                                        />
                                        <CardBody>
                                            <CardText>
                                                {item.displayLink}
                                                <br />
                                                {item.link}
                                            </CardText>
                                            <IframePic
                                                name={item.displayLink}
                                                link={item.link}
                                            />

                                            {/* <iframe
                                            src="https://y7g7g.csb.app/"
                                            title="W3Schools Free Online Web Tutorials"
                                        /> */}
                                            <div className="d-flex justify-content-between align-items-center">
                                                <ButtonGroup>
                                                    <Button
                                                        outline
                                                        color="secondary"
                                                        size="sm"
                                                    >
                                                        View
                                                    </Button>
                                                    <Button
                                                        outline
                                                        color="secondary"
                                                        size="sm"
                                                    >
                                                        Edit
                                                    </Button>
                                                </ButtonGroup>
                                                <small className="text-muted">
                                                    {item.time}
                                                </small>
                                            </div>
                                        </CardBody>
                                    </Card>
                                </Col>
                                );
                            </div>;
                        }
                    })}
                </Row>
            </Container>
        </div>
    );
};

export default Album;
